  }
  render(){
    const { user, users } = this.state;
    return (
        <div className="App">
          <header className="App-header">
            <h1>Box Tracker</h1>
            <p>Welcome, {user.firstname}</p>
          </header>
          <body>
          <p1>Main Menu</p1>
            <p2>Option List Goes Here</p2>
          </body>
        </div>
      );
    }
  }
  

export default Menu;
